  "Allegations" : "FINRA RULES 2010, 8210: WILLIAMSON WAS EMPLOYED AS A REGISTERED REPRESENTATIVE WITH A MEMBER FIRM AND IN HER CAPACITY AS A REGISTERED REPRESENTATIVE, SHE DID NOT HAVE AUTHORITY OR APPROVAL TO ALTER INTEREST RATES CONTAINED IN ANNUITY CONTRACTS ISSUED BY THE FIRM. WILLIAMSON ALTERED ANNUITY CONTRACTS FOR FIRM CUSTOMERS BY CUTTING AND PASTING INCORRECT INTEREST RATES ON THE CONTRACTS WITHOUT THE KNOWLEDGE OR APPROVAL OF THE FIRM. IN ADDITION, WILLIAMSON ALTERED AN ANNUITY CONTRACT FOR ANOTHER FIRM CUSTOMER BY CUTTING AND PASTING AN INCORRECT INTEREST RATE ON AN ANNUITY CONTRACT ISSUED BY THE FIRM WITHOUT THE KNOWLEDGE OR APPROVAL OF THE FIRM. WILLIAMSON MADE A MISREPRESENTATION TO A FIRM CUSTOMER AND ALSO FAILED TO DISCLOSE MATERIAL INFORMATION TO THE CUSTOMER IN CONNECTION WITH THE CUSTOMER'S PURCHASE OF MUTUAL FUND SHARES. WILLIAMSON MISREPRESENTED TO THE CUSTOMER THAT HER ACCOUNT WOULD NOT BE CHARGED A FEE FOR PARTIALLY LIQUIDATING HER MUTUAL FUND INVESTMENT. SUBSEQUENTLY, THE CUSTOMER PURCHASED $156,000 IN MUTUAL FUND SHARES. THE CUSTOMER LIQUIDATED APPROXIMATELY $29,346 OF HER MUTUAL FUND SHARES AND AS A RESULT HER ACCOUNT WAS ASSESSED A CONTINGENT DEFERRED SALES CHARGE (CDSC) OF $299.82 FOR THE LIQUIDATION OF THE SHARES. IN ADDITION, WILLIAMSON FAILED TO RESPOND TO FINRA REQUESTS FOR INFORMATION.",
